import React, { useState } from 'react';
import './Admin.css';

const initialUsers = [
  { id: 1, email: 'alice@example.com', username: 'alice', profilePhoto: 'https://randomuser.me/api/portraits/women/1.jpg' },
  { id: 2, email: 'bob@example.com', username: 'bob', profilePhoto: 'https://randomuser.me/api/portraits/men/2.jpg' },
  { id: 3, email: 'carol@example.com', username: 'carol', profilePhoto: 'https://randomuser.me/api/portraits/women/3.jpg' },
];

const initialRecipes = [
  { id: 1, photo: 'https://images.unsplash.com/photo-1504674900247-0877df9cc836', name: 'Spaghetti', description: 'Classic Italian pasta.', likes: 120 },
  { id: 2, photo: 'https://images.unsplash.com/photo-1512058564366-c9e3e0465e86', name: 'Sushi', description: 'Fresh salmon sushi.', likes: 98 },
  { id: 3, photo: 'https://images.unsplash.com/photo-1464306076886-debca5e8a6b0', name: 'Burger', description: 'Juicy beef burger.', likes: 76 },
];

const getPost = async () => {

    const response = await fetch('http://localhost:4000/admin/posts/all', {
        method: 'POST',
        headers: {
            'Content-Type': 'application/json',
        },
    }); 

}

console.log();


function Admin() {
  const [users, setUsers] = useState(initialUsers);
  const [recipes, setRecipes] = useState(initialRecipes);

  const handleDeleteUser = (id) => {
    setUsers(users.filter(user => user.id !== id));
  };

  const handleDeleteRecipe = (id) => {
    setRecipes(recipes.filter(recipe => recipe.id !== id));
  };

  return (
    <div className="admin-container">
      <h2>Admin Dashboard</h2>
      <div className="admin-section">
        <h3>Users List</h3>
        <table className="admin-table">
          <thead>
            <tr>
              <th>Profile Photo</th>
              <th>Username</th>
              <th>Email</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {users.map(user => (
              <tr key={user.id}>
                <td><img src={user.profilePhoto} alt={user.username} className="profile-photo" /></td>
                <td>{user.username}</td>
                <td>{user.email}</td>
                <td><button className="delete-btn" onClick={() => handleDeleteUser(user.id)}>Delete</button></td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
      <div className="admin-section">
        <h3>Recipes List</h3>
        <table className="admin-table">
          <thead>
            <tr>
              <th>Photo</th>
              <th>Name</th>
              <th>Description</th>
              <th>Likes</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            {recipes.map(recipe => (
              <tr key={recipe.id}>
                <td><img src={recipe.photo} alt={recipe.name} className="recipe-photo" /></td>
                <td>{recipe.name}</td>
                <td>{recipe.description}</td>
                <td>{recipe.likes}</td>
                <td><button className="delete-btn" onClick={() => handleDeleteRecipe(recipe.id)}>Delete</button></td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
}

export default Admin;
